import React, { useEffect, useState } from 'react'

const Data = () => {

    const [users, setUsers] = useState([])

    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/users")
            .then(response => {
                return response.json()
            })
            .then(data => {
                setUsers(data)
            })
    }, []);

    return (
        <>
            <div>
                { users.length > 0 && (
                    <ul>
                        { users.map(user => (
                            <li key={ user.id }>{ user.name }</li>
                        )) }
                    </ul>
                ) }
            </div>
        </>
    )
}

export default Data
